rnalista e assessora de comunicao da Secretaria Municipal da Pessoa com Deficincia de So Paulo, Priscila Fonseca, participa de um bate-papo exclusivo sobre a acessibilidade na web. Em seguida, a reapresentao de um Edio Extra de 2018 a respeito de como alguns projetos digitais contribuem na leitura e no deslocamento das pessoas com deficincia.\n\nEntrevista sobre acessibilidade digital\n\nDe acordo com um levantamento feito pela organizao Web Para Todos, em parceria com BigData, menos de 1% dos sites brasileiros cumprem com todos os requisitos de acessibilidade para que seja visitado por pessoas com alguma deficincia. No entanto, mesmo com mais de 15 milhes de brasileiros com deficincia - um nmero expressivo - por que os desenvolvedores de websites no adequam suas criaes para essa parcela da populao? E como torn-las 100% acessveis?  o que a jornalista Priscila Fonseca discute com o apresentador Caio Mello e o reprter Leonardo Godoy. \n \nMatria sobre acessibilidade e tecnologias que ajudam\n\nVeiculada originalmente em maio de 2018, a reportagem sobre acessibilidade e tecnologias que promovam o acesso s pessoas com deficincia em diferentes mbitos. E ainda, a produo mostra, atravs da viso empreendedora, como o desenvolvimento de tais programas se tornam um diferencial no mercado, a exemplo do caso de Joo Marconi, co-fundador do Guia de Rodas, aplicativo que avalia locais com acessibilidade. O VT ainda conta com a participao de Pedro MIllet, especialista em arquitetura da informao e acessibilidade digital, sobre como boa parte das pessoas com deficincia no tm acesso  informao de recursos e direitos que elas necessitam ter.","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/J_kcV9IqXb0/hqdefault.jpg?sqp=-oaymwEbCKgBEF5IVfKriqkDDggBFQAAiEIYAXABwAEG\u0026rs=AOn4CLCpQidy86OY3Vy1hB_nrhiocpE5Nw","width":168,"height":94},{"url":"https://i.ytimg.com/vi/J_kcV9IqXb0/hqdefault.jpg?sqp=-oaymwEbCMQBEG5IVfKriqkDDggBFQAAiEIYAXABwAEG\u0026rs=AOn4CLDl04S6CSWk discute com o apresentador Caio Mello e o reprter Leonardo Godoy. \n \nMatria sobre acessibilidade e tecnologias que ajudam\n\nVeiculada originalmente em maio de 2018, a reportagem sobre acessibilidade e tecnologias que promovam o acesso s pessoas com deficincia em diferentes mbitos. E ainda, a produo mostra, atravs da viso empreendedora, como o desenvolvimento de tais programas se tornam um diferencial no mercado, a exemplo do caso de Joo Marconi, co-fundador do Guia de Rodas, aplicativo que avalia locais com acessibilidade. O VT ainda conta com a participao de Pedro MIllet, especialista em arquitetura da informao e acessibilidade digital, sobre como boa parte das pessoas com deficincia no tm acesso  informao de recursos e direitos que elas necessitam ter."},"lengthSeconds":"777","ownerProfileUrl":"http://www.youtube.com/@casperlibero","externalChannelId":"UCgbPsqDQtJhxcicUQSK54sw","isFamilySafe":true,"availableCountries":["AD","AE","AF","AG","AI","AL","AM","AO","AQ","AR","AS","AT","AU","AW","AX","AZ","BA","BB","BD","BE","BF","BG","BH","BI","BJ","BL","BM","BN","BO","BQ","BR","BS","BT","BV","BW","BY","BZ","CA","CC","CD","CF","CG","CH","CI","CK","CL","CM","CN","CO","CR","CU","CV","CW","CX","CY","CZ","DE","DJ","DK","DM","DO","DZ","EC","EE","EG","EH","ER","ES","ET","FI","FJ","FK","FM","FO","FR","GA","GB","GD","GE","GF","GG","GH","GI","GL","GM","GN","GP","GQ","GR","GS","GT","GU","GW","GY","HK","HM","HN","HR","HT","HU","ID","IE","IL","IM","IN","IO","IQ","IR","IS","IT","JE","JM","JO","JP","KE","KG","KH","KI","KM","KN","KP","KR","KW","KY","KZ","LA","LB","LC","LI","LK","LR","LS","LT","LU","LV","LY","MA","MC","MD","ME","MF","MG","MH","MK","ML","MM","MN","MO","MP","MQ","MR","MS","MT","MU","MV","MW","MX","MY","MZ","NA","NC","NE","NF","NG","NI","NL","NO","NP","NR","NU","NZ","OM","PA","PE","PF","PG","PH","PK","PL","PM","PN","PR","PS","PT","PW","PY","QA","RE","RO","RS","RU","RW","SA","SB","SC","SD","SE","SG","SH","SI","SJ","SK","SL","SM","SN","SO","SR","SS","ST","SV","SX","SY","S mmandExecutorCommand":{"commands":[{"clickTrackingParams":"CMYBEM2rARgBIhMI1-uvgb3S_QIVjAqRCh0W6QQ1","changeEngagementPanelVisibilityAction":{"targetId":"engagement-panel-structured-description","visibility":"ENGAGEMENT_PANEL_VISIBILITY_EXPANDED"}},{"clickTrackingParams":"CMYBEM2rARgBIhMI1-uvgb3S_QIVjAqRCh0W6QQ1","scrollToEngagementPanelCommand":{"targetId":"engagement-panel-structured-description"}}]}},"showLessCommand":{"clickTrackingParams":"CMYBEM2rARgBIhMI1-uvgb3S_QIVjAqRCh0W6QQ1","changeEngagementPanelVisibilityAction":{"targetId":"engagement-panel-structured-description","visibility":"ENGAGEMENT_PANEL_VISIBILITY_HIDDEN"}},"attributedDescription":{"content":"No segundo bloco, a jornalista e assessora de comunicao da Secretaria Municipal da Pessoa com Deficincia de So Paulo, Priscila Fonseca, participa de um bate-papo exclusivo sobre a acessibilidade na web. Em seguida, a reapresentao de um Edio Extra de 2018 a respeito de como alguns projetos digitais contribuem na leitura e no deslocamento das pessoas com deficincia.\n\nEntrevista sobre acessibilidade digital\n\nDe acordo com um levantamento feito pela organizao Web Para Todos, em parceria com BigData, menos de 1% dos sites brasileiros cumprem com todos os requisitos de acessibilidade para que seja visitado por pessoas com alguma deficincia. No entanto, mesmo com mais de 15 milhes de brasileiros com deficincia - um nmero expressivo - por que os desenvolvedores de websites no adequam suas criaes para essa parcela da populao? E como torn-las 100% acessveis?  o que a jornalista Priscila Fonseca discute com o apresentador Caio Mello e o reprter Leonardo Godoy. \n \nMatria sobre acessibilidade e tecnologias que ajudam\n\nVeiculada originalmente em maio de 2018, a reportagem sobre acessibilidade e tecnologias que promovam o acesso s pessoas com deficincia em diferentes mbitos. E ainda, a produo mostra, atravs da viso empreendedora, como o desenvolvimento de tais programas se tornam um diferencial no mercado, a exem ht.com/8oruKs3KF7wj4HePdcE4DYB_88ZHvU5YqNmZ5Tl3BKR6XnB488-zZGo1rolp8olIn9mGLL9B=s88-c-k-c0x00ffffff-no-rj"}]}}},{"expandableVideoDescriptionBodyRenderer":{"showMoreText":{"simpleText":"Mostrar mais"},"showLessText":{"simpleText":"Mostrar menos"},"attributedDescriptionBodyText":{"content":"No segundo bloco, a jornalista e assessora de comunicao da Secretaria Municipal da Pessoa com Deficincia de So Paulo, Priscila Fonseca, participa de um bate-papo exclusivo sobre a acessibilidade na web. Em seguida, a reapresentao de um Edio Extra de 2018 a respeito de como alguns projetos digitais contribuem na leitura e no deslocamento das pessoas com deficincia.\n\nEntrevista sobre acessibilidade digital\n\nDe acordo com um levantamento feito pela organizao Web Para Todos, em parceria com BigData, menos de 1% dos sites brasileiros cumprem com todos os requisitos de acessibilidade para que seja visitado por pessoas com alguma deficincia. No entanto, mesmo com mais de 15 milhes de brasileiros com deficincia - um nmero expressivo - por que os desenvolvedores de websites no adequam suas criaes para essa parcela da populao? E como torn-las 100% acessveis?  o que a jornalista Priscila Fonseca discute com o apresentador Caio Mello e o reprter Leonardo Godoy. \n \nMatria sobre acessibilidade e tecnologias que ajudam\n\nVeiculada originalmente em maio de 2018, a reportagem sobre acessibilidade e tecnologias que promovam o acesso s pessoas com deficincia em diferentes mbitos. E ainda, a produo mostra, atravs da viso empreendedora, como o desenvolvimento de tais programas se tornam um diferencial no mercado, a exemplo do caso de Joo Marconi, co-fundador do Guia de Rodas, aplicativo que avalia locais com acessibilidade. O VT ainda conta com a participao de Pedro MIllet, especialista em arquitetura da informao e acessibilidade digital, sobre como boa parte das pessoas com deficincia no tm acesso  informao de recursos e direitos que elas necessitam ter."}}}]}},"veType":124975,"targetId":"engag
